
using QuestPDF.Fluent;
using QuestPDF.Infrastructure;
using QuestPDF.Helpers;
using DNATestSystem.BusinessObjects.Application.Dtos.Pdf;
namespace DNATestSystem.APIService.PDF
{
    public class RequestPdfDocument : IDocument
    {
        private readonly PdfExportDto _data;


        string confirmBase64 = "";

        string stampBase64 = "";

        public RequestPdfDocument(PdfExportDto data)
        {
            _data = data;
        }

        public DocumentMetadata GetMetadata() => DocumentMetadata.Default;

        public void Compose(IDocumentContainer container)
        {
            container.Page(page =>
            {
                page.Margin(30);
                page.Size(PageSizes.A4);

                page.Content().Column(col =>
                {
                col.Item().Element(e => e
                .PaddingBottom(10)
                .AlignCenter()
                .Text("PHIẾU KẾT QUẢ XÉT NGHIỆM")
                    .FontSize(20)
                    .Bold()
            );

                col.Item().Text($"Dịch vụ: {_data.ServiceName}");
                col.Item().Text($"Ngày đăng ký mẫu: {_data.ScheduleDate?.ToString("dd/MM/yyyy")}");
                col.Item().Text($"Người yêu cầu: {_data.DeclarantName}");
                col.Item().Text($"Nhân viên xử lý: {_data.StaffName}");
                col.Item().Text($"Địa chỉ: {_data.RequestAddress}");
                col.Item().Text($"Cccd :{_data.IdentityNumber}");
                col.Item().Text($"Số điện thoại: {_data.PhoneNumber}");

                    col.Item().PaddingVertical(10);

                    col.Item().Text("DANH SÁCH NGƯỜI CHO MẪU:").Bold().FontSize(14);

                    col.Item().Table(table =>
                    {
                        table.ColumnsDefinition(c =>
                        {
                            c.RelativeColumn();
                            c.RelativeColumn();
                            c.RelativeColumn();
                            c.RelativeColumn();
                            c.RelativeColumn();
                        });

                        table.Header(header =>
                        {
                            header.Cell().Text("Họ tên").Bold();
                            header.Cell().Text("Giới tính").Bold();
                            header.Cell().Text("Năm sinh").Bold();
                            header.Cell().Text("Quan hệ").Bold();
                            header.Cell().Text("Loại mẫu").Bold();
                        });

                        foreach (var s in _data.Samples)
                        {
                            table.Cell().Text(s.OwnerName);
                            table.Cell().Text(s.Gender);
                            table.Cell().Text(s.Yob?.ToString() ?? "");
                            table.Cell().Text(s.Relationship.ToString());
                            table.Cell().Text(s.SampleType ?? "-");
                        }
                    });
                    col.Item().Text(text =>
                    {
                        text.Span("Kết quả xét nghiệm: ").Bold().FontSize(16);
                        text.Span(_data.ResultData ?? "Chưa có").FontSize(15);
                    })
                    ;
                    col.Item().PaddingVertical(20);

                    // Căn dòng cuối gồm 2 cột trái/phải
                    col.Item().Row(row =>
                    {
                        // Cột trái – Dấu + chữ "HỘI ĐỒNG KHOA HỌC"
                        row.RelativeItem().Column(colLeft =>
                        {
                            colLeft.Item().Text("HỘI ĐỒNG KHOA HỌC")
                                .Bold().FontSize(12)
                                .AlignCenter();

                            colLeft.Item().Element(e => e
                                .AlignCenter()
                                .Height(80)
                                .Image(Convert.FromBase64String(confirmBase64))

                            );
                        });

                        // Cột phải – Đã xác nhận + chữ "TRUNG TÂM XÉT NGHIỆM"
                        row.RelativeItem().Column(colRight =>
                        {
                            colRight.Item().Text("TRUNG TÂM XÉT NGHIỆM")
                                .Bold().FontSize(12)
                                .AlignCenter();

                            colRight.Item().Element(e => e
                                .AlignCenter()
                                .Height(60)
                                .Image(Convert.FromBase64String(stampBase64))

                            );
                        });
                    });


                });
            });
        }
    }
}

